import React from 'react'
import {link} from "react-router-dom"

const Header = () => {

    const style = { display: "inline-vlo"}
    return(
        <div>
            <div>
                <h3>
                    <link to="/" />Home
                </h3>
                <h3>
                    <link to="/quotes" />Quotes
                </h3>

            </div>
        </div>
    )
}

export default Header;
